import React from "react";

const CartoonDetail = () => {
  return (
    <Switch>
      <Route exact path="/CartoonDetail" component={CartoonDetail}>
        <li>
          <img src={props.cartoon.image} alt={props.cartoon.name} />
          <h1> {props.cartoon.name} </h1>
          <p> {props.cartoon.species}</p>
          <p> {props.cartoon.planet}</p>
          <p> {props.cartoon.episodes}</p>
          <p> {props.cartoon.status}</p>
        </li>
      </Route>
    </Switch>
  );
};

export default CartoonDetail;
